import SearchBar from "./components/SearchBar/SearchBar";
import { Link } from "react-router-dom";


const Nav=({onSearch})=>{
    return(
        <nav>
       <Link>
          <button>Home</button>
        </Link>
        <Link>
        <button>About</button>
        </Link>
        <SearchBar onSearch={onSearch}/>
    
     </nav>
    )
}

export default Nav;
